            /* cards carousels */

            .cards {
              display: none;
              position: relative;
              max-width: 300px;
            }

            .cards_scroller {
              overflow-x: scroll;
              overflow-y: hidden;
              display: flex;
              height: 210px;
              width: 300px;
              transition: width 0.5s ease;
              margin-left: 5px;
              /* Enable Safari touch scrolling physics which is needed for scroll snap */
              -webkit-overflow-scrolling: touch;
