            .cards_scroller > div.carousel_cards {
              margin: 5px;
              scroll-snap-align: center;
              position: relative;
              scroll-behavior: smooth;
            }

            .cards_scroller div.carousel_cards {
              min-width: 50%;
              min-height: 70%;
              background: #b5b5b5;
              border-radius: 10px;
            }

            @-webkit-keyframes fadeInLeft {
              from {
                opacity: 0;
                -webkit-transform: translatex(-10px);
                -moz-transform: translatex(-10px);
                -o-transform: translatex(-10px);
                transform: translatex(-10px);
              }
              to {
                opacity: 1;
                -webkit-transform: translatex(0);
                -moz-transform: translatex(0);
                -o-transform: translatex(0);
                transform: translatex(0);
              }
            }

            .in-left {
              -webkit-animation-name: fadeInLeft;
              -moz-animation-name: fadeInLeft;
              -o-animation-name: fadeInLeft;
              animation-name: fadeInLeft;
              -webkit-animation-fill-mode: both;
              -moz-animation-fill-mode: both;
              -o-animation-fill-mode: both;
              animation-fill-mode: both;
              -webkit-animation-duration: 0.8s;
              -moz-animation-duration: 0.8s;
              -o-animation-duration: 0.8s;
              animation-duration: 0.8s;
              -webkit-animation-delay: 0.8s;
              -moz-animation-delay: 0.8s;
              -o-animation-duration: 0.8s;
              animation-delay: 0.8s;
            }

            /* css for cards within the cards carousels */

            .cardBackgroundImage {
              width: 100%;
              border-radius: 5px;
              height: 100%;
              position: absolute;
              object-fit: cover;
            }

            .cardFooter {
              background: rgba(56, 53, 60, 0.86);
              border-radius: 0px 0px 5px 5px;
              position: absolute;
              z-index: 3;
              color: white;
              bottom: 0;
              width: 100%;
              height: 30%;
              word-wrap: break-word;
              padding: 1px;
            }

            .cardTitle {
              overflow: hidden;
              white-space: nowrap;
              text-overflow: ellipsis;
              width: 90%;
              /* height: 40%; */
              display: inline-block;
              margin-bottom: 1px;
              font-size: 15px;
              /* font-weight: 600; */
              padding: 5px;
              /* color:#060dcfc7; */
              color: #ffffff;
              cursor: pointer;
            }

            .cardDescription {
              padding: 5px;
              font-size: 13px;
              color: white;
              line-height: 15px;
            }

            /*css for dropDown messages*/

            .dropDownMsg {
              float: left;
              margin-top: 5px;
              background: white;
              color: black;
              box-shadow: 2px 3px 9px 0px #9a82842e;
              margin-left: 0.5em;
              padding: 10px;
              border-radius: 1.5em;
              max-width: 60%;
              min-width: 25%;
              font-size: 13px;
              word-wrap: break-word;
            }

            .dropDownMsg > select {
              border: 0px solid #f2f2f2;
            }

            /* css for quick replies */

            .quickReplies {
              padding: 5px;
              position: relative;
              width: 100%;
              overflow-x: scroll;
              overflow-y: hidden;
              white-space: nowrap;
              transition: all 0.2s;
              transform: scale(0.98);
              will-change: transform;
              user-select: none;
              cursor: pointer;
              scroll-behavior: smooth;
            }

            .quickReplies::-webkit-scrollbar {
              width: 0 !important;
            }

            .quickReplies.active {
              cursor: grabbing;
              cursor: -webkit-grabbing;
              transform: scale(1);
            }

            .chip {
              background-color: white;
              border: 1px solid#060dcfc7;
              color: #060dcfc7;
              font-weight: bolder;
              text-align: center;
            }

            .chip:hover {
              background-color: #060dcfc7;
              color: white;
            }

            /* css for charts */

            #expand:hover {
              font-size: 18px;
            }

            #expand {
              position: absolute;
              right: 10px;
              top: 10px;
            }

            .modal {
              height: 60%;
              border-radius: 10px;
            }

            .chart-container {
              position: relative;
              margin: auto;
              height: 25vh;
              width: 90%;
              border-radius: 10px 10px 10px 10px;
              margin-left: 5%;
              background: white;
              box-shadow: 2px 3px 9px 0px #9a82847a;
              margin-top: 5px;
            }

            /* css for collapsible */

            .collapsible {
              margin-top: 5px;
              margin-left: 5%;
              max-width: 60%;
              min-width: 25%;
              font-size: 13px;
              word-wrap: break-word;
              border-radius: 20px;
              background: white;
            }

            .collapsible-body {
              padding: 15px;
            }

            .collapsible-header {
              font-weight: bold;
              color: #060dcfc7;
            }

            ul.collapsible > li:first-child .collapsible-header {
              border-radius: 20px 20px 0px 0px;
            }

            ul.collapsible > li:last-child .collapsible-header {
              color: #060dcfc7;
              border-radius: 0px 0px 20px 20px;
            }

            ul.collapsible > li:last-child .collapsible-body {
              border-bottom: none;
            }

            .collapsible-header {
              padding: 10px;
            } 

            /* css for botTyping */

            .botTyping {
              float: left;
              margin-top: 5px;
              background: #e3e7ee;
              color: #000000;
              /* box-shadow: 2px 3px 9px 0px #9a82847a; */
              margin-left: 0.5em;
              padding: 15px;
              border-radius: 5px 20px 20px 20px;
              max-width: 60%;
              min-width: 20%;
              word-wrap: break-word;
              border-radius: 5px 20px 20px 20px;
            }

            .botTyping > div {
              width: 10px;
              height: 10px;
              background-color: #060dcfc7;
              border-radius: 100%;
              display: inline-block;
              -webkit-animation: sk-bouncedelay 1.4s infinite ease-in-out both;
              animation: sk-bouncedelay 1.4s infinite ease-in-out both;
              margin-right: 5px;
            }

            .botTyping .bounce1 {
              -webkit-animation-delay: -0.32s;
              animation-delay: -0.32s;
            }

            .botTyping .bounce2 {
              -webkit-animation-delay: -0.16s;
              animation-delay: -0.16s;
            }

            @-webkit-keyframes sk-bouncedelay {
              0%,
              80%,
              100% {
                -webkit-transform: scale(0);
              }
              40% {
                -webkit-transform: scale(1);
              }
            }

            @keyframes sk-bouncedelay {
              0%,
              80%,
              100% {
                -webkit-transform: scale(0);
                transform: scale(0);
              }
              40% {
                -webkit-transform: scale(1);
                transform: scale(1);
              }
            }

            input:focus {
              outline: none;
            }

            video:focus {
              outline: none;
            }

            .video-container iframe,
            .video-container object,
            .video-container embed {
              position: absolute;
              top: 0;
              left: 0;
              width: 90%;
              height: 100%;
              margin-left: 5%;
              border-radius: 10px;
              border-style: none;
            }

            /* Bot pop-up intro */

            .tap-target {
              color: #fff;
              background: #060dcfc7;
            }

            .pdf_attachment {
              border: 0.5px solid #00000014;
              width: 60%;
              height: 14%;
              border-radius: 10px;
              margin-left: 10%;
              box-shadow: 2px 3px 9px 0px #9a82842e;
            }

            .pdf_icon {
              border-radius: 10px 0px 0px 10px;
              height: 100%;
              font-size: 25px;
              padding: 7% !important;
              background-color: #060dcfc7;
              color: white;
            }

            .pdf_link {
              padding: 5% !important;
              white-space: nowrap;
              overflow: hidden;
              text-overflow: ellipsis;
            }

            .pdf_link a {
              color: #060dcfc7;
            }

            .container{
              z-index: 9999 !important;
            }


