            /* Link Animation*/
            a.left-underline-anim
            {
                position: relative;
            }

            a.left-underline-anim:after {
            	content: "";
              position: absolute;
              width: 0;
              height: 2px;
              bottom: -2px;
              left: 0;
              background-color: #099188;
              visibility: hidden;
              transition: all 0.3s ease-in-out;

            }

            a.left-underline-anim:hover:after {
              visibility: visible;
              width: 100%;
            }



